import React, { useState, useEffect } from "react";
import { analyzeLanguages } from "../api";

const MainPage = () => {
  const [data, setData] = useState([]);
  const GITHUB_TOKEN = "your_github_token";
  const GOOGLE_API_KEY = "your_google_api_key";

  useEffect(() => {
    const fetchData = async () => {
      const languages = ["Python", "JavaScript", "Java", "C#", "C++"];
      const results = await analyzeLanguages(languages, GITHUB_TOKEN, GOOGLE_API_KEY);
      setData(results);
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Language Trends</h1>
      <table>
        <thead>
          <tr>
            <th>Language</th>
            <th>GitHub Trends</th>
            <th>StackOverflow Trends</th>
            <th>Google Trends</th>
            <th>Trend Score</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.language}>
              <td>{item.language}</td>
              <td>{item.github}</td>
              <td>{item.stackOverflow}</td>
              <td>{item.googleTrend}</td>
              <td>{item.trendScore}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MainPage;
